import React, {useEffect} from "react";
import SearchBar from "./components/SearchBar/SearchBar";
import BookData from "./Data.json";
//thoughts: post=> Review first unapproved, admin page has unapproved request (add dorm request);
/// add dorm request contains review (dormname) + dormname+location+dormrating(default 0) if dormname not in review then he is adding a dorm
/// if 
import { useDispatch } from 'react-redux'
import { getSchools } from './actions/schools'


import {
  BrowserRouter,
  Routes,
  Route,
  Switch
} from "react-router-dom";
import Home from "./pages/home/Home";
import Login from "./pages/login/Login";
import AddDorm from "./pages/AddDorm/AddDorm"
import School from "./pages/School/School";

function App() {
  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(getSchools());
  }, [dispatch]);

  return (
    <BrowserRouter>
      <Switch>
        <Route path="/" exact component={Home} />
        <Route path="/login" exact component= {Login}/>
        <Route path="/AddDorm/:id" exact component= {AddDorm}/>
        <Route path="/dorms/:id" exact component= {School}/>

      </Switch>
    </BrowserRouter>
  );
}

export default App;
